import React, { Component, useEffect, useState } from "react";
import axios from "axios";
import { Map, TileLayer, Popup, Marker } from "react-leaflet";
import {Container, Card, Card2} from '../Styles/Style';


const Acidentes = (props) => {

  return (
  <Container>
        <Card>
          <p>OCORRENCIAS</p>
          <p>Nome: {props.teste.name}</p>
          <p>ID: {props.teste.id}</p>
          </Card>
    </Container>
  );
};

export default Acidentes;
